    doc.root.children.each do |path| 
      if anim_values[i]
        animate = XML::Node.new('animate') 
        animate["dur"] = "animDuration;"
        animate["repeatCount"] = "indefinite"
        animate["attributeName"] = "d"
        animate["values"] = "#{path["d"]};#{anim_values[i]};#{path["d"]}"
        path << animate
